description:
Coupon Organizer, Scanner and Reminder, this All-in-One coupon tracking app will make your life easier. Scan or type coupon's barcode and let this coupon organizer handle the rest for you.

Do you want to save $$$ by using coupons but also want to SAVE TIME to input/organize/track your coupons? Download this coupon organizer, scan the coupon, and be a happy couponer!

Main features:
- Scan coupon barcode to input coupon details automatically;
- Search coupon barcode to input coupon details automatically, it's very handy when
  your device has difficulty to recognize coupon barcode;
- Bulk import coupons from Sunday newspaper inserts;
- Huge online coupon database and keep growing over time to provide most accurate
  information ;
- Manually input coupon if scan/search doesn't work;
- Get notification before your coupons expire, the notification can be customized
  to specified favorite level only or all the coupons;
- Coupon Statistics tracks your saving automatically;
- Ranking your coupons and you will never forget the HOTTEST coupons;
- Take photo of your coupons to help you to visualize them, it comes handy when to
  locate them from thousands of coupons;
- Edit Name/Category/Value/Quantity/Expiration/Source/Detail for each coupon as you
  want;
- Customizable categories and sources help you organize your coupons electronically
  and physically;
- Badge number at list screen tells the coupon's available quantity;
- Search though your coupons by name, category, source, details and notes;
- Sort your coupons by Expiration Date, Name, Category or Favorite Level;
- Filter your coupons by Category, Source and/or Source Date;
- Separate 'Expired and Used' coupons automatically from other coupons and move to
  archive to save your time. But you still have the chance to review them at any
  time;
- Customize your system to keep or delete the expired/redeemed coupon
  automatically;
- Import/Export coupon data to backup or just keep multiple devices data in sync
- Create coupon list (with or without filter) in spreadsheet format and view/edit
  using other program like Excel or Numbers;

